import React, { Component } from "react";

class ProjectsList extends Component {
  renderProjects() {
    if (this.props.projects) {
      return this.props.projects.map((project) => {
        return (
          <li
            key={project.id}
            className={project.activeProject ? "active" : ""}
          >
            {project.projectId} - {project.projectTitle}
          </li>
        );
      });
    } else {
      return <h3>Loading...</h3>; //TODO: Make this more exciting?
    }
  }

  renderActiveProject() {
    if (this.props.activeProject) {
      console.log(this.props.activeProject);
      return this.props.activeProject.title;
    } else {
      return "No Project Selected";
    }
  }

  render() {
    return (
      <div>
        <h1>Active Project: {this.renderActiveProject()}</h1>

        <h1>All Projects:</h1>
        <ul>{this.renderProjects()}</ul>
      </div>
    );
  }
}

export default ProjectsList;
